    }

    return (
        <>
            <Box className="s-home-3">
                <Box className="s-home-content">
                    <Container>
                        <Box className="s-form-content">
                            <Box sx={{ width: "100%", minHeight: height, }}>
                                <Box className="b-card-3">
                                    <Typography className="b-title">Change Password</Typography>
                                    <Typography className="b-desc">Make sure you remember your password</Typography>
                                </Box>
                                <Box className="s-form">
                                    <FormInput
                                        title={"Old Password"}
                                        placeholder={"Type your current password"}
                                        value={""}
                                        isDefault={true}
                                        name="OLD_PASS"
                                        disable={false}
                                        handleEvent={() => {}}
                                        isImportant={true}
                                        inputProp={{ inputMode: 'text',}}
                                        />
                                    <FormInput
                                        title={"New Password"}
                                        placeholder={"Create new password"}
                                        value={""}
                                        isDefault={true}
                                        name="OLD_PASS"
                                        disable={false}
                                        handleEvent={() => {}}
                                        isImportant={true}
                                        inputProp={{ inputMode: 'text',}}
                                        />
                                    <FormInput
                                        title={"Confirm New Password"}
                                        placeholder={"Type your new password"}
                                        value={""}
                                        isDefault={true}
                                        name="OLD_PASS"
                                        disable={false}
                                        handleEvent={() => {}}
                                        isImportant={true}
                                        inputProp={{ inputMode: 'text',}}
                                        />
                                </Box>
                                <Box className="s-bot">
                                    <ButtonPrimary title={"Confirm"} handleClick={handleClick} />
                                </Box>
                            </Box>
                        </Box>
                    </Container>
                </Box>
            </Box>
        </>
    )
}

export default LoginPage;
